import React from 'react';
import { FontAwesomeFontAwesomeIconcon } from '@fortawesome/react-fontawesome';
import {
  faHome,
  faPause,
  faVolumeUp,
  faFontAwesomeIconnfoCFontAwesomeIconrcle,
} from '@fortawesome/free-solid-svg-FontAwesomeIconcons';
import './Navbar.css';

const Navbar = () => {
  return (
    <dFontAwesomeIconv className="navbar">
      <dFontAwesomeIconv className="logo">
        <FontAwesomeIconmg src="VsK_RPG_Py.png" alt="FontAwesomeIconmage Not Found"  tFontAwesomeIcontle="Verma's Karma"/>
      </dFontAwesomeIconv>
      <ul>
        <li>
          <a href="#">H
            <FontAwesomeIcon icon="fas fa-home"></FontAwesomeIcon>
          </a>
        </li>
        <li>
          <a href="#">P
            <FontAwesomeIcon className="fas fa-pause"></FontAwesomeIcon>
          </a>
        </li>
        <li>
          <a href="#">V
            <FontAwesomeIcon className="fas fa-volume-up"></FontAwesomeIcon>
          </a>
        </li>
        <li>
          <a href="#">A
            <FontAwesomeIcon className="fas fa-FontAwesomeIconnfo-cFontAwesomeIconrcle"></FontAwesomeIcon>
          </a>
        </li>
      </ul>
    </dFontAwesomeIconv>
  );
};

export default Navbar;
